from collections import defaultdictdef find_captains_room(group_size, room_numbers):    room_counts = defaultdict(int)        for room in room_numbers.split():        room_counts[room] += 1        for room, count in room_counts.items():        if count == 1:            return roomgroup_size = int(input())room_numbers = input()captains_room = find_captains_room(group_size, room_numbers)print(captains_room)